// src/pages/EditPackages.js
import React, { useEffect, useState } from 'react';

export default function EditPackages() {
  const [packages, setPackages] = useState([]);
  const [form, setForm] = useState({
    destination: '',
    price: '',
    duration: '',
    activities: ''
  });

  // Fetch all packages
  const fetchPackages = async () => {
    try {
      const res = await fetch('http://localhost:5001/packages');
      const data = await res.json();
      setPackages(data);
    } catch (err) {
      console.error('Error fetching packages:', err);
    }
  };

  useEffect(() => {
    fetchPackages();
  }, []);

  // Handle form input change
  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  // Add a package
  const handleAdd = async (e) => {
    e.preventDefault();
    try {
      const res = await fetch('http://localhost:5001/packages', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({
          ...form,
          price: parseFloat(form.price),
          duration: parseInt(form.duration),
          activities: form.activities.split(',').map(a => a.trim())
        })
      });

      if (res.ok) {
        setForm({ destination: '', price: '', duration: '', activities: '' });
        fetchPackages();
      } else {
        const err = await res.json();
        alert(err.error || 'Failed to add package');
      }
    } catch (err) {
      console.error('Error adding package:', err);
    }
  };

  // Remove a package
  const handleDelete = async (id) => {
    try {
      const res = await fetch(`http://localhost:5001/packages/${id}`, {
        method: 'DELETE'
      });

      if (res.ok) {
        fetchPackages();
      } else {
        alert('Failed to delete package');
      }
    } catch (err) {
      console.error('Error deleting package:', err);
    }
  };

  return (
    <div className="p-6">
      <h2 className="text-3xl font-bold mb-6">✏️ Edit Packages</h2>

      {/* Add Package Form */}
      <form onSubmit={handleAdd} className="bg-white p-4 rounded shadow mb-8 w-full max-w-md">
        <h3 className="text-xl font-semibold mb-2">Add New Package</h3>
        <input type="text" name="destination" placeholder="Destination" value={form.destination} onChange={handleChange} required className="w-full mb-2 p-2 border rounded" />
        <input type="number" name="price" placeholder="Price" value={form.price} onChange={handleChange} required className="w-full mb-2 p-2 border rounded" />
        <input type="number" name="duration" placeholder="Duration (days)" value={form.duration} onChange={handleChange} required className="w-full mb-2 p-2 border rounded" />
        <input type="text" name="activities" placeholder="Activities (comma separated)" value={form.activities} onChange={handleChange} required className="w-full mb-2 p-2 border rounded" />
        <button type="submit" className="bg-blue-600 text-white px-4 py-2 rounded hover:bg-blue-700">Add Package</button>
      </form>

      {/* Package List */}
      <h3 className="text-2xl font-semibold mb-4">📦 Existing Packages</h3>
      {packages.length === 0 ? (
        <p>No packages found.</p>
      ) : (
        <ul className="space-y-4">
          {packages.map(pkg => (
            <li key={pkg._id} className="bg-gray-100 p-4 rounded shadow flex justify-between items-center">
              <div>
                <p><strong>{pkg.destination}</strong> - ₹{pkg.price} - {pkg.duration} days</p>
                <p className="text-sm text-gray-600">Activities: {pkg.activities.join(', ')}</p>
              </div>
              <button onClick={() => handleDelete(pkg._id)} className="bg-red-500 text-white px-3 py-1 rounded hover:bg-red-600">Delete</button>
            </li>
          ))}
        </ul>
      )}
    </div>
  );
}
